import React from "react";
import { Link } from "react-router-dom";

const Nav = () => {
  return (
    <div class="Nav">
      <Link to="/">Home</Link>
      <Link to="/Contact">Contact</Link>
      <Link to="/Pricing">Pricing</Link>
    </div>
  );
};

export default Nav;
